import styled from 'styled-components';

export const HeroContainer = styled.div`
	background: #0c0c0c;
	display: flex;
	justify-conetent: center;
	align-items: center;
	padding: 0 30px;
	height: 800px;
	position: reletive;
	z-index: 1;
`;

export const HeroBg = styled.div`
	position: absolute;
	top: 0;
	right: 0;
	bottom: 0;
	left: 0;
	width: 100%;
	height: 100%;
	overflow: hidden;
`;

export const VideoBg = styled.video`
	width: 100%;
	height: 100%;
	-o-object-fit: cover;
	object-fit: cover;
	background: #232a34;
`;

export const Herotext = styled.div`
	z-index: 3;
    max-width: 1200px;
    position: absolute;
    padding 8px 24 px;
    display:flex;
    flex-direction:column;
    align-items: center
`;

export const HeroH1 = styled.h1`
	color: white;
	font-size: 42px;
	text-align: center;

	@media screen and(max-width:780) {
		font-size: 38px;
	}

	@media screen and();
`;

export const HeroP = styled.p``;
